// Variables

let validateDelayCheck = null;
let fromParameters = false;
let profileUrl = '';

// Functions

var copyToClipboard = function (string) {
  const cb = navigator.clipboard;
  cb.writeText(string).then(() => console.log(`Copied the following to the clipboard:\n\n${string}`));
};

var getQueryStringArray = function() {
  let assoc=[];
  let items = window.location.search.substring(1).split('&');
  for(let j = 0; j < items.length; j++) {
    let a = items[j].split('='); assoc[decodeURIComponent(a[0])] = decodeURIComponent(a[1]);
  }
  return assoc;
};

var getProfileUrl = function(profile, copyBtn, pInvalid, containedNewUrl, spanMastoRedirURL) {
  let profileUrl = '';

  let profileArray = profile.split("@");
  let username = profileArray.length == 3 ? profileArray[1] : '';
  let server = profileArray.length == 3 ? profileArray[2] : '';
  let validatedUsername = validMastodonUsername.test(username);
  let validatedServer = mastodonServers[server];

  // Test if the new value is a valid profile, to enable the copy to clipboard button
  let pInvalidTextElement = pInvalid.firstChild;
  if (validatedUsername && validatedServer) {
    // we have a valid profile
    profileUrl = "https://"+server+"/@"+username;
    // the replaceAll's are required to avoid Twitters text detection of "mastodon"
    let redirectUrl = window.location.origin+window.location.pathname+'?u='+username.replaceAll(wordMatch,wordEncoded)+'&s='+server.replaceAll(wordMatch,wordEncoded);
    if (copyBtn.classList.contains('disable')) copyBtn.classList.remove('disable');
    if (!copyBtn.hasAttribute('onclick')) copyBtn.setAttribute("onclick", `copyToClipboard("${redirectUrl}")`);
    if (!pInvalid.classList.contains('hide')) pInvalid.classList.add('hide');
    if (containedNewUrl.classList.contains('hide')) containedNewUrl.classList.remove('hide');
    spanMastoRedirURL.innerText = redirectUrl;
  } else {
    // need to reset when profile isn't valid or no text is entered
    if (!copyBtn.classList.contains('disable')) copyBtn.classList.add('disable');
    if (copyBtn.hasAttribute('onclick')) copyBtn.removeAttribute('onclick');
    if (pInvalid.classList.contains('hide')) pInvalid.classList.remove('hide');
    if (!containedNewUrl.classList.contains('hide')) containedNewUrl.classList.add('hide');
    if (!validatedUsername && !validatedServer) pInvalidTextElement.innerHTML = "Profile entered is invalid, please make sure it matches the format.";
    else if (!validatedUsername) pInvalidTextElement.innerHTML = "Username entered is invalid.";
    else if (!validatedServer) pInvalidTextElement.innerHTML = `Server entered is invalid, if you feel this is an error, then please submit an issue on <a href="${githubNewIssueURL}">GitHub</a>.`;
    spanMastoRedirURL.innerText = '';
  }

  return profileUrl;
};

// Wait for page to load
window.addEventListener('load', function() {
  // Elements

  let inputMastodonProfile = document.getElementById(inputMastodonProfileID);
  let containerNewUrl = document.getElementById(containerNewUrlID);
  let spanMastodonRedirectUrl = document.getElementById(spanMastodonRedirectUrlID);
  let aCopyBtn = document.getElementById(aCopyBtnID);
  let pInvalidProfile = document.getElementById(pInvalidProfileID);
    
  // Main

  // check URL parameters first
  let paramUsername = getQueryStringArray().u;
  let paramServer = getQueryStringArray().s;
  let paramProfile = getQueryStringArray().p || (paramUsername && paramServer) ? ('@'+paramUsername+'@'+paramServer) : null;
  if (paramProfile) {
    fromParameters = true;
    inputMastodonProfile.value = paramProfile;
    console.log(`Validating "${paramProfile}" as valid Mastodon profile...`);
    // run checker once as is necessary
    let validateProfileUrl = getProfileUrl(paramProfile, aCopyBtn, pInvalidProfile, containerNewUrl, spanMastodonRedirectUrl);
    if (validateProfileUrl) {
      console.log(`Redirecting to "${validateProfileUrl}"...`);
      window.location = validateProfileUrl;
    }
  }

  // detect any changes to profile value
  inputMastodonProfile.oninput = function() {
    // needs to be captured before checking since it changes fast
    let currentProfile = inputMastodonProfile.value;
    getProfileUrl(currentProfile, aCopyBtn, pInvalidProfile, containerNewUrl, spanMastodonRedirectUrl);
  }
});
